import React from "react";
import CardHorizontal from "../../components/websiteMobile/card/cardHorizontal/CardHorizontal";
import "./Cart.css";
import {useSelector} from "react-redux";
const Cart = ()=>{

    const {productsCart} = useSelector((state) => state.productCart);

    return(
        <div className="cartContainer">
            <div className="cartTitle">
                <h1>Shoping cart</h1>
            </div>
            <div className="cartCardHoriontal">
                <CardHorizontal/>
                <CardHorizontal/>

            </div>
            <div className="cartTotal">
                <div>
                   <div className="span"> <span>Total price: </span> <span>$10</span></div>
                    <div className="btn">
                        <button>Cancel</button> <button className="one">Place order</button>
                    </div>
                </div>

            </div>
        </div>
    )
}

export default Cart;
